window.bookSummaryJSON = "<p><b>After one thousand years, the sleeping fae are awakening…and chaos will reign.</b></p> <p>Bride. Idol. Betrayer.</p> <p>Promised to a villainous future king, Sabine once dreamed of forsaking everything for the huntsman who captured her heart. But Wolf's devastating betrayal locks her in another prison: the sinful court of her betrothed. There, she forges an unexpected alliance with her future husband. He's ambitious. Handsome. Surprisingly complex. Together, they might save the kingdom of Astagnon from a waking evil—but in harnessing her power, she risks becoming what she most despises.</p> <p>Huntsman. Fighter. Sinner.</p> <p>Wolf believed betraying Sabine was the only way to ensure her safety. Now, tormented by the sight of another man's ring on her finger, his role as her bodyguard keeps him achingly close to the woman he can't have. To hide Sabine's dangerous secret even from herself—and to stop a coming war—he ventures to the enemy's borders. What awaits him is an explosive discovery that thrusts him into a dark past he thought was long buried.</p> <p>In a dance of danger and desire, it's more than their lives in peril—it's their hearts at war.</p> <p><i>In the second installment of the Godkissed Bride series, Evie Marceau delivers another captivating romantic fantasy where love defies destiny, fae gods rise, and hearts are set ablaze. Perfect for fans who love arranged marriage, fae lore, spice, and enemies-to-lovers romance.</i></p>"; 
